import React from 'react';

const SearchBar = () => {
  return (
    <React.Fragment>
      <div className="input-wrapper" type="search" id="search">
        <i class="fa-solid fa-magnifying-glass"></i>
      </div>
    </React.Fragment>
  );
};

export default SearchBar;
